//<h1> for a title and a <p> for the content.

import React from "react";

function Note() {
  return (
    <div className="note">
      <h1 >Esse é o título da nota</h1>
      <p className="note">Esse é o conteudo da nota</p>
    </div>
  );
}

export default Note;
